import {
    UniqueIdentifier,
} from '@dnd-kit/core';

import React, {useState} from 'react';

export const [parent, setParent] = useState<UniqueIdentifier | null>(null);
export const [isDragging, setIsDragging] = useState(false);

export function setParentValue(n : any) {
    setParent(n);
}

export function getParent(n : any) {
    return parent;
}

export function setIsDraggingValue(n : any) {
    setIsDragging(n);
}

export function getIsDragging(n : any) {
    return isDragging;
}
